import React, { useState, useEffect } from "react";
import axios from "axios";
import UploadBox from "./components/UploadBox";

const BACKEND = "http://127.0.0.1:8000";

export default function App() {
  const [summary, setSummary] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [darkMode, setDarkMode] = useState(false);
  const [insights, setInsights] = useState({});

  const handleUpload = async (file) => {
    setError("");
    setLoading(true);
    setSummary(null);
    setInsights({});

    try {
      const formData = new FormData();
      formData.append("file", file);

      const res = await axios.post(`${BACKEND}/upload`, formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });

      const data = res.data;
      if (data.download_url && data.download_url.startsWith("/")) {
        data.download_url = BACKEND + data.download_url;
      }

      setSummary(data);
      computeInsights(data.sample_data);
    } catch (err) {
      console.error(err);
      setError(err?.response?.data?.detail || "Error processing file.");
    } finally {
      setLoading(false);
    }
  };

  const computeInsights = (data) => {
    if (!data || data.length === 0) return;

    const numericCols = {};
    const ageValues = [];

    Object.keys(data[0]).forEach((key) => {
      const nums = data.map((row) => parseFloat(row[key])).filter((v) => !isNaN(v));
      if (nums.length > 0) numericCols[key] = nums;
      if (key.toLowerCase().includes("age")) ageValues.push(...nums);
    });

    const insights = {};
    if (numericCols["Score"] || numericCols["score"]) {
      const col = numericCols["Score"] || numericCols["score"];
      const avg = (col.reduce((a, b) => a + b, 0) / col.length).toFixed(1);
      insights.averageScore = avg;
    }

    if (ageValues.length > 0) {
      const avgAge = Math.round(ageValues.reduce((a, b) => a + b, 0) / ageValues.length);
      const groupStart = Math.floor(avgAge / 5) * 5;
      insights.commonAgeGroup = `${groupStart}-${groupStart + 5}`;
    }

    setInsights(insights);
  };

  useEffect(() => {
    document.body.style.backgroundColor = darkMode ? "#121212" : "#f5f5f5";
    document.body.style.color = darkMode ? "#eee" : "#222";
  }, [darkMode]);

  const sectionStyle = {
    backgroundColor: darkMode ? "#1e1e1e" : "#fff",
    padding: "20px",
    marginTop: "25px",
    borderRadius: "10px",
    boxShadow: darkMode
      ? "0 0 8px rgba(255,255,255,0.1)"
      : "0 0 8px rgba(0,0,0,0.1)",
  };

  return (
    <div style={{ maxWidth: 900, margin: "40px auto", padding: "20px", fontFamily: "Arial" }}>
      {/* Header */}
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <h1>📊 DataClean Analyzer</h1>
        <button
          onClick={() => setDarkMode(!darkMode)}
          style={{
            padding: "6px 12px",
            borderRadius: "8px",
            cursor: "pointer",
            border: "none",
            background: darkMode ? "#ddd" : "#222",
            color: darkMode ? "#222" : "#fff",
          }}
        >
          {darkMode ? "☀️ Light Mode" : "🌙 Dark Mode"}
        </button>
      </div>
      <p>Upload a CSV or Excel file. The system will clean, analyze, and extract key data insights.</p>

      {/* Upload Section */}
      <div style={sectionStyle}>
        <h2>📁 Upload Section</h2>
        <UploadBox onUpload={handleUpload} loading={loading} />
        {loading && <p style={{ color: "#888" }}>⏳ Processing file... please wait.</p>}
        {error && <p style={{ color: "red" }}>{error}</p>}
      </div>

      {/* Summary Section */}
      {summary && (
        <div style={sectionStyle}>
          <h2>📈 Summary</h2>
          <ul>
            <li><b>Total Rows:</b> {summary.total_rows ?? "N/A"}</li>
            <li><b>Cleaned Rows:</b> {summary.cleaned_rows ?? "N/A"}</li>
            <li><b>Rows Removed (%):</b> {summary.rows_removed_percent ?? "0%"}</li>
            <li><b>Missing Values:</b> {summary.missing_values ?? "N/A"}</li>
            <li>
              <b>Columns:</b> {Array.isArray(summary.columns) ? summary.columns.join(", ") : "N/A"}
            </li>
          </ul>
        </div>
      )}

      {/* Data Insights Section */}
      {insights && Object.keys(insights).length > 0 && (
        <div style={sectionStyle}>
          <h2>💡 Data Insights</h2>
          <ul>
            {insights.averageScore && <li><b>Average Score:</b> {insights.averageScore}</li>}
            {insights.commonAgeGroup && <li><b>Most Common Age Group:</b> {insights.commonAgeGroup}</li>}
          </ul>
        </div>
      )}

      {/* Data Preview Section */}
      {summary && (
        <div style={sectionStyle}>
          <h2>🧾 Data Preview</h2>
          <div style={{ overflowX: "auto" }}>
            <table
              border="1"
              cellPadding="6"
              cellSpacing="0"
              style={{
                width: "100%",
                borderCollapse: "collapse",
                backgroundColor: darkMode ? "#2a2a2a" : "#fafafa",
                color: darkMode ? "#eee" : "#222",
              }}
            >
              <thead>
                <tr>
                  {summary.columns.map((c) => (
                    <th
                      key={c}
                      style={{
                        backgroundColor: darkMode ? "#333" : "#e0e0e0",
                        textAlign: "left",
                      }}
                    >
                      {c}
                    </th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {summary.sample_data.map((row, i) => (
                  <tr key={i}>
                    {summary.columns.map((c) => (
                      <td key={c}>{row[c] ?? ""}</td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}

      {/* Download Section */}
      {summary && summary.download_url && (
        <div style={sectionStyle}>
          <h2>⬇️ Download</h2>
          <a href={summary.download_url} target="_blank" rel="noreferrer">
            <button
              style={{
                padding: "10px 16px",
                border: "none",
                borderRadius: "6px",
                backgroundColor: "#007bff",
                color: "white",
                cursor: "pointer",
              }}
            >
              Download Cleaned CSV
            </button>
          </a>
        </div>
      )}
    </div>
  );
}
